import React from "react";
import "./Skill.css";
import Web from "../../img/web.png";
import Arch from "../../img/arch.png";
import Design from "../../img/design.png";

const Skill = () => {
  return (
    <div className="skill">
      <div className="technical">
        <span>My Technical</span>
        <span>Skills</span>
        <span>
          Expertise in object-oriented programming, developing, and testing.
          <br />
          Experience in full-stack Web/Mobile development by using HTML, CSS,
          JavaScript, MongoDB, Express, React and NodeJS.
          <br />
          Proficient in computational design and UX design in Architecture and
          Engineering industry.
        </span>
        <button className="button s-button">Download CV</button>
        <div className="blur s-blur1" style={{ background: "#ABF1FF94" }}></div>
      </div>
      <div className="cards">
        <Card
          emoji={Web}
          heading={"Developer"}
          detail={
            "Programming Language: Java, Python, C/C++, JavaScript, HTML/CSS; Database Management: MySQL, PostgreSQL, MongoDB;Developer Tools: AWS, Git, IntelliJ, Eclipse, VS Code, XCode, Android Studio;Frameworks: Express, React, Node, Spring Boot, Bootstrap"
          }

          // Architecture = {Arch}
          // Design = {Design}
        />
      </div>
    </div>
  );
};

export default Skill;
